    :root {
      --max-width: 280px;
      --max-bag-width: 122px;
      --background-primary: #0a7aff;

      --background-secondary: #f0f0f0;
      --background-third: #e6e6e6;
      --text-primary: #000;
      --text-secondary: #fff;
      --text-third: #b3b3b3;
      --list-dot: #ffac00;

      --hide-picture-duration: .8s;
      --move-bag-duration: 0.6s;
      --show-content-duration: 0.3s;
      --hide-content-duration: .15s;
      --show-crown-duration: .45s;
      --show-perfume-duration: .7s;
      --show-applewatch-duration: .4s;

      --hide-picture-delay: 0s;
      --move-bag-delay: calc(var(--hide-picture-duration) + .5s);
      --show-content-base-delay: calc(var(--move-bag-delay) + var(--move-bag-duration) + .4s);
      --show-crown-delay: calc(var(--show-content-base-delay) + .3s + .03s);
      --show-perfume-delay: calc(var(--show-content-base-delay) + .3s + .03s);
      --show-applewatch-delay: calc(var(--show-content-base-delay) + .3s + .09s);
    }

    * {
      box-sizing: border-box;
      font-family: medium;
      color: var(--text-primary);
      line-height: normal;
    }

    body {
      margin: 0;
      overflow: hidden;
    }

    h1,
    h2,
    h3,
    p,
    ul {
      margin: 0;
      padding: 0;
    }

    button {
      transition: opacity ease .1s;
    }

    .screen {
      position: absolute;
      top: 0;
      right: 0;
      left: 0;
      bottom: 0;
      width: 100%;
      height: 100%;

      display: flex;
      flex-direction: column;
      justify-content: flex-start;
      align-items: stretch;
    }

    .screen-1 {
      padding: 48px;
      box-sizing: initial;
      max-width: var(--max-width);
      margin: 0 auto;
    }

    .screen-2 {
      opacity: 0;
      visibility: hidden;
      padding-bottom: 15px;
    }

    .start-anim .screen-2 {
      opacity: 1;
      visibility: visible;
      transition: all var(--show-content-duration) var(--move-bag-delay) linear;
    }

    .picture_container {
      position: relative;
      margin: calc(48 / 812 * 100 * 1vh) auto 0;
      width: 279px;
      height: 265px;
      border-radius: 22px;
    }

    .picture_wrap:before {
      content: '';
      display: block;
      position: absolute;
      top: -2px;
      bottom: -2px;
      left: -2px;
      width: 0;
      border-right: 2px solid var(--background-primary);
      background-color: #fff;
    }

    .start-anim .picture_wrap {
      opacity: 0;
      visibility: hidden;
      transition: all var(--hide-content-duration) var(--hide-picture-duration) linear;
    }

    .start-anim .picture_wrap:before {
      animation: hidePicture var(--hide-picture-duration) linear forwards;
    }

    .bag {
      width: 122px;
      height: auto;
      max-width: var(--max-bag-width);

      position: absolute;
      left: 84.5px;
      bottom: 29px;
      z-index: 3;
    }

    .start-anim .bag {
      animation: moveBag var(--move-bag-duration) var(--move-bag-delay) linear forwards;
    }

    .title {
      position: relative;
      font-family: bold;
      font-size: 32px;
      letter-spacing: -1.12px;
    }

    .text {
      font-size: 16px;
      letter-spacing: -0.56px;
    }

    .title-1 {
      margin-top: calc(48 / 812 * 100 * 1vh);
    }

    .text-1 {
      margin-top: calc(12 / 812 * 100 * 1vh);
    }

    .start-anim .title-1,
    .start-anim .text-1 {
      opacity: 0;
      visibility: hidden;
      transition: all var(--show-content-duration) var(--hide-picture-duration) linear;
    }

    .btn_close {
      position: absolute;
      top: calc(54 / 812 * 100 * 1vh);
      left: 20px;

      width: 30px;
      height: 30px;

      display: flex;
      justify-content: center;
      align-items: center;

      border: none;
      border-radius: 50%;
      background: #fff;

      opacity: 0;
      visibility: hidden;
    }

    .btn_restore {
      position: absolute;
      top: calc(54 / 812 * 100 * 1vh);
      right: 16px;

      color: #828286;
      background: rgba(255, 255, 255, 0.83);
      border: none;
      border-radius: 15px;
      padding: 8px 10px;

      text-align: center;
      font-family: semibold;
      font-size: 12px;
      line-height: normal;

      opacity: 0;
      visibility: hidden;
    }

    .start-anim .btn_close,
    .start-anim .btn_restore {
      opacity: 1;
      visibility: visible;
      transition: all var(--show-content-duration) var(--show-content-base-delay) linear;
    }

    .crown {
      position: absolute;
      width: 99px;
      height: 99px;
      right: 5px;
      bottom: -80px;

      transition: transform var(--show-crown-duration) var(--show-crown-delay) ease-out;
      transform: translateX(90px);
    }

    .perfume {
      position: absolute;
      width: 55px;
      height: 86px;
      left: 0;
      bottom: -82px;

      transition: transform var(--show-perfume-duration) var(--show-perfume-delay) ease-out;
      transform: translateX(-70px);
    }

    .applewatch {
      position: absolute;
      width: 68px;
      height: 111px;
      right: 0;
      bottom: -68px;

      transition: transform var(--show-applewatch-duration) var(--show-applewatch-delay) ease-out;
      transform: translateX(70px);
    }

    .start-anim .crown,
    .start-anim .perfume,
    .start-anim .applewatch {
      transform: translateX(0px);
    }

      left: 0;
      top: 0;
      width: 0;
      height: 100%;
      border-radius: 25px;
      background-color: var(--background-secondary);
      z-index: 3;
    }

    .swipe-text {
      position: absolute;
      left: 0;
      top: 0;
      width: 100%;
      height: 100%;
      border-radius: 25px;
      background-color: transparent;
      -webkit-touch-callout: none;
      /* iOS Safari */
      -webkit-user-select: none;
      /* Safari */
      -khtml-user-select: none;
      /* Konqueror HTML */
      -moz-user-select: none;
      /* Firefox */
      -ms-user-select: none;
      /* Internet Explorer/Edge */
      user-select: none;
      /* Non-prefixed version, currently
                                  supported by Chrome and Opera */
    }

      justify-content: center;
      align-items: center;

      height: 52px;

      padding: 6px;
      width: var(--max-width);
      height: 64px;
      border-radius: 34px;

      height: 100%;

      line-height: normal;

      opacity: 0;
      visibility: hidden;
      transition: all .3s linear;

  <script>
    class slideToUnlock {
      constructor(el, options) {
        this.$el = el;
        this.$drag;
        this.start = false;
        this.leftEdge;
        this.rightEdge;
        this.mouseX;

        this.settings = {
          // unlockText    : "Slide To Unlock",
          useData: false,
          unlockfn: function () {
            console.log("unlock")
          },
          lockfn: function () {},
          allowToLock: true,
          status: false
        }

        // Establish our default settings
        this.settings = Object.assign(this.settings, options);
        if (this.settings.useData) {
          if (!("unlockText" in this.settings) && this.$el.data("unlock-text")) {
            this.settings.unlockText = this.$el.data("unlock-text");
          }
          if (!("lockText" in this.settings) && this.$el.data("lock-text")) {
            this.settings.lockText = this.$el.data("lock-text");
          }

          this.settings.status = this.$el.data("status");
        }

        if (!("lockText" in this.settings)) {
          this.settings.lockText = "Slide To Unlock";
        }

        if (!("unlockText" in this.settings)) {
          this.settings.unlockText = this.settings.lockText;
        }

        this.init();
        return this;
      };

      init() {
        this.$el.addClass('slideToUnlock');
        this.leftEdge = this.$el.offset().left;
        this.rightEdge = this.leftEdge + this.$el.outerWidth();

        this.$el.addClass("locked");
        this.$el.append("<div class='progressBar unlocked'></div>");
        this.$el.append("<div class='swipe-text'>" + this.settings.lockText + "</div>");
        this.$el.append("<div class='drag locked_handle'></div>");

        this.$text = this.$el.find('.swipe-text');
        this.$drag = this.$el.find('.drag');
        this.$progressBar = this.$el.find(".progressBar");


        this.$drag.on("mousedown.slideToUnlock touchstart.slideToUnlock", this.touchStart.bind(this));

        if (this.settings.status) {
          this.$drag.css({
            left: "auto",
            right: 0
          });
          this.$progressBar.css({
            width: "100%"
          });
        }
      }

      touchStart(event = window.event) {
        this.start = true;
        this.leftEdge = Math.trunc(this.$el.offset().left);
        this.rightEdge = Math.trunc(this.leftEdge + this.$el.outerWidth());

        $(document).on("mousemove.slideToUnlock touchmove.slideToUnlock", this.touchMove.bind(this));
        $(document).on("mouseup.slideToUnlock touchend.slideToUnlock", this.touchEnd.bind(this));
        this.mouseX = (event.type == 'mousedown') ? event.pageX : event.originalEvent.touches[0].pageX;

        event.preventDefault();
      }

      touchMove(event = window.event) {
        if (!this.start) return;
        var X = (event.type == 'mousemove') ? event.pageX : event.originalEvent.touches[0].pageX;
        var changeX = (X - this.mouseX);
        var edge = Math.trunc(this.$drag.offset().left) + changeX;
        this.mouseX = X;

        if (edge < this.leftEdge) {
          if (this.settings.status)
            this.settings.lockfn(this.$el);
          this.$text.text(this.settings.lockText);
          this.$drag.removeClass('unlocked_handle').addClass('locked_handle');
          this.start = false;
          this.settings.status = false;
          this.touchEnd();
          return;
        }

        if (edge > this.rightEdge - this.$drag.outerWidth()) {
          if (!this.settings.status) {
            this.settings.unlockfn(this.$el);
          }
          this.$text.text(this.settings.unlockText);
          this.$drag.removeClass('locked_handle').addClass('unlocked_handle');
          if (!this.settings.allowToLock) {
            this.$drag.off("mousedown.slideToUnlock touchstart.slideToUnlock");
          }
          this.settings.status = true;
          this.start = false;
          this.touchEnd();
          return;
        }

        this.$drag.offset({
          left: edge
        });
        this.$progressBar.css({
          "width": edge - this.$el.offset().left + this.$drag.outerWidth()
        });

        event.stopImmediatePropagation();
      }

      touchEnd(event = window.event) {
        this.start = false;
        this.mouseX = 0;
        if (!this.settings.status) {
          this.$drag.animate({
            left: 0,
            "margin-left": 0
          });
          if (this.$progressBar.width() > this.$drag.width()) {
            this.$progressBar.animate({
              width: this.$drag.width()
            }, function () {
              this.$progressBar.css({
                width: 0
              });
            }.bind(this));
          }
        }

        if (this.settings.status) {
          this.$drag.animate({
            "left": "100%",
            "margin-left": "-50px"
          });
          this.$progressBar.animate({
            width: "100%"
          });
        }

        $(document).off("mousemove.slideToUnlock touchmove.slideToUnlock");
        $(document).off("mouseup.slideToUnlock touchend.slideToUnlock");
        event.stopImmediatePropagation();
      }
    };

    (function ($) {
      $.fn.slideToUnlock = function (options) {
        $.each(this, function (i, el) {
          new slideToUnlock($(el), options);
        });
        return this;
      }
    }(jQuery));
  </script>
  <script>
    $(document).ready(function () {
      $(".swipe").slideToUnlock({
        lockText: 'Slide to remove back',
        unlockfn: () => {
          const body = document.querySelector('body');

          setTimeout(() => {
            body.classList.add('start-anim');
          }, 500);

          setTimeout(() => {
            window.ReactNativeWebView.postMessage('app_landing_shown');
          }, 3500);
        },
      });
    });

    document.onreadystatechange = () => {
      if (document.readyState === 'complete') {
        window.ReactNativeWebView.postMessage("app_onbord1_shown");
      }
    };

    const closeBtn = document.querySelector('.btn_close');
    const restoreBtn = document.querySelector('.btn_restore');
    const subBtn = document.querySelector('.btn_sub');

    const checkbox_week = document.querySelector(".checkboxes_week");
    const checkbox_year = document.querySelector(".checkboxes_year");
    let checked_plan = 'week';

    closeBtn.addEventListener('touchstart', () => {
      closeBtn.style.opacity = '.7';
    })
    closeBtn.addEventListener('mousedown', () => {
      closeBtn.style.opacity = '1';
    })
    closeBtn.addEventListener('click', () => {
      window.ReactNativeWebView.postMessage('close');
    })

    restoreBtn.addEventListener('touchstart', () => {
      restoreBtn.style.opacity = '.7';
    })
    restoreBtn.addEventListener('mousedown', () => {
      restoreBtn.style.opacity = '1';
    })
    restoreBtn.addEventListener('click', () => {
      window.ReactNativeWebView.postMessage('restore');
    })

    checkbox_week.addEventListener('click', () => {
      checked_plan = 'week';

      checkbox_week.classList.add('checked');
      checkbox_year.classList.remove('checked');
      subBtn.textContent = 'Continue to trial';

      window.ReactNativeWebView.postMessage('week_checked');
    })

    checkbox_year.addEventListener('click', () => {
      checked_plan = 'year';

      checkbox_year.classList.add('checked');
      checkbox_week.classList.remove('checked');
      subBtn.textContent = 'Continue';

      window.ReactNativeWebView.postMessage('year_checked');
    })

    subBtn.addEventListener('touchstart', () => {
      subBtn.style.opacity = '.7';
    })
    subBtn.addEventListener('mousedown', () => {
      subBtn.style.opacity = '1';
    })
    subBtn.addEventListener('click', () => {
      window.ReactNativeWebView.postMessage(`subscription, tariff: ${checked_plan}`);
    })

    window.addEventListener('message', message => {
      const price = document.querySelector('.price');
      const week_price = document.querySelector('.week_price');
      const year_price = document.querySelector('.year_price');
      const data = JSON.parse(message.data);

      if (data.type === "price") {
        price.textContent = data.price;
      }

      if (data.type === "all_prices") {
        data.allPrices.forEach(item => {
          switch (item.type) {
            case "week":
              week_price.textContent = item.price;
              break;
            case "year":
              year_price.textContent = item.price;
              break;
          }
        })
      }
    })
  </script>
</body>

</html>
